import React, { useEffect, useState } from'react';
import axios from 'axios';

function App() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    axios.get('http://localhost:3001/posts')
      .then(res => {
        setPosts(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, []);
  return (
    <div className="App">
      look in console
      {posts.map(post => {
        return <h3>{post.title}</h3>
      })}
    </div>
  );
}

export default App;
